import * as types from '../types';

export const fetchposts = () => async dispatch => {
    const res = await axios.get('https://apvbackendmanager.azurewebsites.net/ApvSimulacion/obtenerporid?id=7');
    dispatch({
        type: types.GET_POSTS,
        payload:res.data
    });
}
